handNote.p:
Den anden skriver har skrevet bl. 55v-62v. Han skrev også følgende notits på bl. 55v: leſ betur enn ſkrifat er kiærí fadir ok seg halfridi goda notth og 56r: amen. jllt er blekit enn vera ſskrifit barbara and 62v. Louis-Jensen (
Seg Hallfríði góða nótt
) foreslår, at den Hallfríði som bliver nævnt på bl. 55v kunne være Hallfríði Þórðardttir, kusine til bonden Gísli Filippusson på Hagi i Barðarströnd og muligvis próventukona på Hagi.
